import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { Helmet } from "react-helmet";
import axios from "axios";
import Footer from "../components/footer";
import "./user-dashboard.css";

const UserDashboard = () => {
  const [userData, setUserData] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchUserData = async () => {
      try {
        const user = JSON.parse(localStorage.getItem("user"));
        if (!user) {
          navigate("/login");
          return;
        }
        const response = await axios.get(`http://localhost:8000/users/${user.user_id}`);
        setUserData(response.data);
      } catch (error) {
        console.error("Error fetching user data:", error);
        navigate("/login");
      }
    };
    fetchUserData();
  }, [navigate]);

  if (!userData) {
    return <div>Loading...</div>;
  }

  return (
    <div className="dashboard-container">
      <Helmet>
        <title>User Dashboard</title>
      </Helmet>
      <div className="overview-title">
        <h2>Overview</h2>
        <div className="underline"></div>
      </div>
      <div className="dashboard-content">
        {/* Left Section */}
        <div className="left-section">
          <h3>Details</h3>
          <div className="tabs">
            <span>Analytics</span>
            <span>Insights</span>
            <span>Upgrade Plan</span>
            <span>Update Profile</span>
          </div>
          <div className="description">
            <p>{userData.sub_details}</p>
            <p>{userData.user_details}</p>
          </div>
          <div className="stats">
            <div className="stat-box purple-box">
              <h3>56</h3>
              <p>Reports Generated</p>
            </div>
            <div className="stat-box">
              <h3>10</h3>
              <p>Features Explored</p>
            </div>
            <div className="stat-box">
              <h3>{userData.days_left}</h3>
              <p>Days Left</p>
            </div>
          </div>
        </div>
        {/* Right Section */}
        <div className="right-section">
          <div className="user-info">
            <div className="avatar-placeholder"></div>
            <h3>{userData.user_id}</h3>
            <p>{userData.profession}</p>
          </div>
          <div className="activities">
            <h4>Last Activities</h4>
            <div className="activity-box">
              <p>Your Application has been accepted by 3 Companies</p>
            </div>
            <div className="activity-box">
              <p>Your Application has been accepted by 3 Companies</p>
            </div>
            <div className="activity-box">
              <p>Your Application has been accepted by 3 Companies</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default UserDashboard;
